import { createWebHistory, createRouter } from "vue-router";

const routes =  [
  {
    path: "/home",
    alias: "/home",
    name: "home",
    // component: () => import("./components/inventory")
  },
  {
    path: "/inventory",
    alias: "/inventory",
    name: "inventory",
    // component: () => import("./components/inventory")
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
